/*
 * alive 값이 1이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 0이 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
int alive = 1;

pthread_mutex_t r_mutex;
pthread_mutex_t w_mutex;
pthread_mutex_t readTry;
pthread_mutex_t resource;

int w_cnt=0;
int r_cnt=0;


/*
 * Reader 스레드는 같은 문자를 N번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;

    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {

      pthread_mutex_lock(&readTry); //reader가 읽기를 시도
      pthread_mutex_lock(&r_mutex); //다른 reader와의 경쟁을 피하기 위해서 lock을 걸어줌/entry section
      r_cnt++; // reader의 수 업데이트
      if(r_cnt == 1){//만약 첫 번째 reader라면,
        pthread_mutex_lock(&resource);//reader를 위한 리소스 액세스 요청
      }
      pthread_mutex_unlock(&r_mutex);//리소스 액세스 해제/entry seciton
      pthread_mutex_unlock(&readTry);//reader의 읽기 시도가 완료됨.

        /*
         * Begin Critical Section
         */
        printf("<");
        for (i = 0; i < N; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /*
         * End Critical Section
         */

         pthread_mutex_lock(&r_mutex);//reader끼리의 race condition을 피하기 위함/exit section시작
         r_cnt--; //reader가 떠남
         if(r_cnt == 0){ //마지막 reader가 떠났는지 확인
           pthread_mutex_unlock(&resource);//마지막인 경우, 리소스 액세스 해제
         }
         pthread_mutex_unlock(&r_mutex);//다른 Reader를 위해 lock해제/exit section종료
    }
    pthread_exit(0);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 세 가지 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req, rem;

    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 이미지 출력을 천천히 하기 위해 한 줄 출력할 때마다 쉬는 시간을 1 나노초로 설정한다.
     */
    req.tv_sec = 0;
    req.tv_nsec = 1L;

    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {

      pthread_mutex_lock(&w_mutex); // writer를 위한 입력 섹션을 예약
      w_cnt++;//자신을 입력하는 writer로 봄
      if(w_cnt==1){//만약 첫 번째 순서라면,
        pthread_mutex_lock(&readTry);//reader가 cs에 진입하지 못하게 함
      }
      pthread_mutex_unlock(&w_mutex);//입력 섹션에서 해제
      pthread_mutex_lock(&resource);//다른 writer가 동시에 입력하지 못하도록 리소스에 lock을 걸어줌.


        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i) {
                    printf("%s\n", t[i]);
                    nanosleep(&req, &rem);
                }
                break;
            case 1:
                for (i = 0; i < L2; ++i) {
                    printf("%s\n", d[i]);
                    nanosleep(&req, &rem);
                }
                break;
            case 2:
                for (i = 0; i < L3; ++i) {
                    printf("%s\n", e[i]);
                    nanosleep(&req, &rem);
                }
                break;
            default:
                ;
        }
        /*
         * End Critical Section
         */
         pthread_mutex_unlock(&resource);//exit section시작
         w_cnt--;//writer가 떠남
         if(w_cnt==0){//마지막 writer라면,
           pthread_mutex_unlock(&readTry);//reader의 lock을 해제해주어 cs접근을 허용해줌.
         }
         pthread_mutex_unlock(&w_mutex);//exit section종료
    }
    pthread_exit(0);
}

/*
 * 메인 함수는 RNUM 개의 reader 스레드를 생성하고, WNUM 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 자연스럽게 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
    int i;
    int rarg[RNUM], warg[WNUM];
    pthread_t rthid[RNUM];
    pthread_t wthid[WNUM];
    struct timespec req, rem;

    pthread_mutex_init(&r_mutex,NULL);
    pthread_mutex_init(&w_mutex,NULL);
    pthread_mutex_init(&readTry,NULL);
    pthread_mutex_init(&resource,NULL);
    /*
     * Create RNUM reader threads
     */
    for (i = 0; i < RNUM; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /*
     * Create WNUM writer threads
     */
    for (i = 0; i < WNUM; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /*
     * Wait for 0.2 second while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = 200000000L;
    nanosleep(&req, &rem);
    /*
     * Now terminate all threads and leave
     */
    alive = 0;
    for (i = 0; i < RNUM; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < WNUM; ++i)
        pthread_join(wthid[i], NULL);
    exit(0);
}
